import React from 'react';
import './App.css';

function Nav() {
    return (
        <nav>
            <h3>Logo</h3>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Projects</li>
            </ul>
        </nav>
    )
}

export default Nav;
